Programėlės tikslas – skatinti neatlygintiną kraujo donorystę, palengvinti registracijos kraujo donorystei procesą bei suburti neatlygintinų kraujo donorų bendruomenę.

Pagrindinės „Mano kraujas“ programėlės funkcijos:
–     Registracija kraujo donorystei;
–     Kraujo donorystės statuso ir istorijos peržiūra;
–     Naujienos ir specialūs pasiūlymai;
–     Interaktyvus kraujo davimo vietų žemėlapis;
–     Mano draugai – kraujo donorai;
–     Bendra statistika.

IMPULS programėlė - tai nepamainomas įrankis visiems sportuojantiems sporto ir sveikatingumo klubuose IMPULS. Pasirinkę programėlėje savo lankomą IMPULS klubą, Jūs galėsite:

•matyti treniruočių tvarkaraščius, atsirinkdami savo mėgiamus užsiėmimus pagal laiką, pagal treniruotės pavadinimą, pagal trenerį;
•susidėlioti savo asmeninį mėgiamų treniruočių grafiką ir pridėti treniruotes į savo telefono kalendorių, tam kad sportas taptų jūsų dienotvarkės dalimi ir visada žinotumėte, kada IMPULS treneris jūsų laukia;
•matyti visus pasikeitimus savo IMPULS klubo tvarkaraščiuose;
•sužinoti šviežiausias IMPULS klubo naujienas ir skaityti Jums skirtas žinutes;
•pasiskaityti apie Jūsų mėgiamą treniruotę ar trenerį;
•sužinoti klubo darbo laiką, greitai ir patogiai paskambinti bei užsiregistruoti į užsiėmimus;
•rasti artimiausią IMPULS klubą.

Tai pirmoji mūsų programėlės versiją, kurią dar pildysime papildomomis ir Jums patogiomis funkcijomis. 

Ačiū, kad sportuojate su mumis ir iš anksto dėkojame už Jūsų nuomonę, pastebėjimus ir komentarus bei pasiūlymus. Jų lauksime apps@impuls.lt arba apačioje komentaruose.

Tikimės, kad ši programėlė, kaip ir sportas – taps sveikų Jūsų kasdieniu įpročiu, nes geriausia diena sportuoti yra ŠIANDIEN!
IMPULS. Sveikas įprotis.

